                    title: 'CCTV emerges of moment Sicily yacht sank as search efforts continue – video report',
                    category: 'news',
                    duration: 102,
                    source: 'Reuters',
                    posterUrl: 'https://media.guim.co.uk/3696e6fe0dd253249a1a46079bf4c095f9487756/0_0_1920_1080/master/1920.jpg',
                    description: '<p>A luxury yacht carrying 22 passengers including the software tycoon Mike Lynch sank off the coast of Sicily during an unexpected and severe storm. Matthew Schanck, a maritime expert, told Reuters it was likely to have been caused by a waterspout, a rare occurrence in the waters around the Italian island. He called it a \'black swan event\' and said understanding what caused the boat to tilt was critical. CCTV footage taken from the port shows the yacht apparently disappearing into the darkness. Six people are missing, including Lynch and his daughter Hannah. One body has been recovered, believed to be that of the yacht\'s chef</p><ul><li><p><a href="https://www.theguardian.com/world/live/2024/aug/21/slugs-sicily-bayesian-yacht-sinking-search-mike-lynch-six-people-missing-updates">Sicily yacht sinking – live updates</a></p></li><li><p><a href="https://www.theguardian.com/world/article/2024/aug/20/bayesian-yacht-sinking-divers-search-missing-people-mike-lynch-sicily">Bayesian yacht sinking: six presumed dead as divers try to access cabins</a></p></li></ul>',
